import axios from 'axios'
import { GET_USER } from '../../action/types'

const initialState = {
    user: {}
}

const userReducer = (state = initialState, action) => {
    switch (action.type) {
        case GET_USER:
            console.log("GETTING USER REDUCER")
            return {
                ...state,
                items: action.payload
            }
        case 'REMOVE':
            return state;
        default:
            return state;
    }
}

export default userReducer;
